DFD001.Description of CMU Components:
CMU is a 32MW 32MWh Lithium Iron Battery Electric Storage System. The BESS is co-located with a solar PV system and shares a grid connection. The solar PV and the BESS will be separately metered, and registered as separate BMUs. The BESS will connect to the grid via the 20/66 kV substation of the Facility, connecting to additional panels on the 33 kV switchgear. The main assets, elements and systems forming the Electricity Storage Facility are: 
16 containers with Lithium Ion battery modules (LFP), containers further including HVAC, fire extinguishing system and controls; 
8 PCS skids, each comprising of 2x 2000 kVA converter, a 4 MVA 0.8/33 kV step up transformer and a 630A 33 kV Ring Main Unit (RMU);

