28 containers with Lithium Ion battery modules (LFP), containers further including HVAC, fire extinguishing system and controls; 
7 PCS skids, each comprising of 2x 2000 kVA converter, a 4 MVA 0.8/20kV step up transformer and a 630A 20 kV Ring Main Unit (RMU);
